import{_ as E,o as A,c as i,e as I}from"./app.457dfeaf.js";const R={},e=I(`<h1 id="为什么需要ts以及配置与debug" tabindex="-1"><a class="header-anchor" href="#为什么需要ts以及配置与debug" aria-hidden="true">#</a> 为什么需要TS以及配置与debug</h1><h3 id="为什么我们需要typescript" tabindex="-1"><a class="header-anchor" href="#为什么我们需要typescript" aria-hidden="true">#</a> 为什么我们需要TypeScript？</h3><h4 id="什么是typescript" tabindex="-1"><a class="header-anchor" href="#什么是typescript" aria-hidden="true">#</a> 什么是TypeScript？</h4><p>在我们学习一项技能前，我们应该先了解这是个什么东西。TypeScript（后文简称为TS）是JavaScript（后文简称为JS）的超集。支持JS包括实验特性的所有写法，你也可以在TS文件中写纯JS代码。此外，TS也有很多JS没有的新特性，比如抽象类，枚举等等。而TS相较JS最重要的功能就是<strong>类型</strong>，实际上你可以认为TS就是带类型的JS。</p><p>当然，在JS中也有如<code>string</code>，<code>number</code>等基本类型，而对于一个对象，它的类型都是<code>object</code>，而在TS中，允许你声明对象的类型。可能你会觉得这很麻烦，跟JS相比太不灵活了，但实际上TS的类型<strong>并不死板</strong>，你可以使用<strong>泛型</strong>让其变得灵活。</p><p><img src="https://www.runoob.com/wp-content/uploads/2019/01/ts-2020-11-26-2.png" alt="img"></p><h4 id="ts的出现解决了什么" tabindex="-1"><a class="header-anchor" href="#ts的出现解决了什么" aria-hidden="true">#</a> TS的出现解决了什么？</h4><p>有些人认为<strong>JS</strong>的初衷就是能够简单快速的编写web应用，而<strong>TS</strong>相对来说复杂太多。而伴随着web应用的功能的增多，代码复杂度也相应的增加。<strong>JS</strong>作为动态类型的缺点就大于优点了。在JS中如果是由于类型而导致的错误，我们得在运行后才能找到问题，但是使用TS我们能够在写代码时就发现问题，这带来的时间收益无疑是巨大的。</p><h4 id="我能用ts来干什么" tabindex="-1"><a class="header-anchor" href="#我能用ts来干什么" aria-hidden="true">#</a> 我能用TS来干什么？</h4><p>有很多朋友想要使用一种编程语言做一个完整的web项目，因为这样我们能够少花很多精力。要知道，<strong>JS</strong>是一门一专多能的语言，而<strong>TS</strong>是<strong>JS</strong>的超集，你能在任何可以使用JS的地方使用TS。你可以使用TS来构建web应用，使用vue，react来编写前端（在浏览器中js几乎是你的唯一选择），使用node+nestjs来编写后端（在大多数时候完全够用，并且你能够通过TS学习设计模式）。你也可以使用electricon来编写桌面端程序（比如vscode就是使用electricon+ts编写的），使用babylon.js来写web游戏或者在web中进行模型展示等等。</p><h4 id="ts编写起来太慢了" tabindex="-1"><a class="header-anchor" href="#ts编写起来太慢了" aria-hidden="true">#</a> TS编写起来太慢了？</h4><p>光看代码，TS确实比JS写得更多。但在vscode中，我们使用TS能够得到完善的代码补全的提示，比如这个数组的元素为number类型，我们得到的代码补全提示都是number类型的方法：</p><p><img src="data:image/png;base64," alt=""></p><p>而且我们写程序时，写代码的时间占少数，有很多时间是在找bug或者进行测试。而TS能够帮助我们在编写代码时就提前避免错误，也大大减少了bug数，要让编程的效率高，我们应该在减少bug和进行测试下功夫。而不是单纯的看代码量的多少。</p><p>比如我们这里的函数有可能就没有返回值，在JS中我们是没有这个提示的，（当然，这需要配置tsconfig.json文件。在后面的文章中会提到这个配置）</p><p><img src="data:image/png;base64," alt=""></p><p>所以为了让项目遵循&quot;软件工程学&quot;，我们得学习<strong>TS</strong>并且在项目中使用它。并且，你可以发现各个框架，库都开始使用TS来代替JS了。而我们使用TS能够得到更好的代码补全的提示。</p><h3 id="ts的安装" tabindex="-1"><a class="header-anchor" href="#ts的安装" aria-hidden="true">#</a> TS的安装</h3><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>npm install -g typescript
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>我们先使用npm或者pnpm来全局安装ts</p><h3 id="如何运行ts文件" tabindex="-1"><a class="header-anchor" href="#如何运行ts文件" aria-hidden="true">#</a> 如何运行TS文件</h3><p>首先我们需要知道的是ts暂时还不能在浏览器上直接运行（TS团队正在为此做出努力），也就是说所有ts文件最后都是要编译成js文件的。我们使用ts的编译器只是为了使用它的类型检测以及一些特性。在项目中，我们会借助打包工具（如vite，webpack）将其编译成js文件并打包。但在我们学习ts时，使用ts的<code>tsc</code>指令进行编译就行了。</p><p>生成js文件（一次性）</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>tsc 文件名
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>然后使用node指令来运行js文件</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>node demo.js
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>监听，每次保存会自动编译后修改js文件</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>tsc 文件名 -w
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>或者安装<code>ts-node</code></p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>npm install -g ts-node

npm install -D tslib @types/node
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>然后使用<code>ts-node</code>指令运行文件</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>ts-node demo.ts
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><h3 id="tsconfig-json文件配置" tabindex="-1"><a class="header-anchor" href="#tsconfig-json文件配置" aria-hidden="true">#</a> tsconfig.json文件配置</h3><p><code>tsconfig.json</code>文件是ts编译器的配置文件，我们可以通过这个配置文件来规范我们的代码，比如：“如果重写方法必须使用<code>override</code>关键字”。这将能够使我们能够写出更加规范的代码。</p><p>下面我们做一些简单的配置：</p><ul><li><p>生成tsconfig文件</p><p>在终端输入<code>tsc --init</code></p></li><li><p>&quot;target&quot;: &quot;es2016&quot;</p><p>输出的js文件的标准，建议使用es2016</p></li><li><p>&quot;rootDir&quot;: &quot;./src&quot;,</p><p>ts的根文件目录</p></li><li><p>&quot;outDir&quot;: &quot;./dist&quot;,</p><p>ts生成的js文件的目录</p></li><li><p>&quot;removeComments&quot;: true,</p><p>如果报错，不生成js文件</p></li><li><p>&quot;sourceMap&quot;: true,</p><p>为编译好的js文件创建相应的映射文件（使用debug和断点）</p></li></ul><h3 id="debug与lunch-json文件" tabindex="-1"><a class="header-anchor" href="#debug与lunch-json文件" aria-hidden="true">#</a> debug与lunch.json文件</h3><p>VS Code中的debug是一个非常好用工具，此外，VS Code对Node.js运行时具有内置的调试支持（其他语言需要额外下载扩展），并且可以调试 JavaScript、TypeScript 或任何其他转换为 JavaScript 的语言。</p><p>那我们该怎样使用它呢？</p><p>在vscode中点击debug，并创建lunch.json文件，在<code>program</code>下添加<code>&quot;preLaunchTask&quot;: &quot;tsc: 构建 - tsconfig.json&quot;,</code></p><p><strong>注意：tsc后对于中文用户是构建，而对于其他语言的用户可能的是其他的字符，如英文为<code>build</code></strong></p><p>你可以使用<code>ctrl+shift+B</code>来查看任务（如果你使用的搜狗输入法，请先切换输入法，因为有按键的冲突）</p><div class="language-json line-numbers-mode" data-ext="json"><pre class="language-json"><code><span class="token punctuation">{</span>
  <span class="token property">&quot;version&quot;</span><span class="token operator">:</span> <span class="token string">&quot;0.2.0&quot;</span><span class="token punctuation">,</span>
  <span class="token property">&quot;configurations&quot;</span><span class="token operator">:</span> <span class="token punctuation">[</span>
    <span class="token punctuation">{</span>
      <span class="token property">&quot;type&quot;</span><span class="token operator">:</span> <span class="token string">&quot;node&quot;</span><span class="token punctuation">,</span>
      <span class="token property">&quot;request&quot;</span><span class="token operator">:</span> <span class="token string">&quot;launch&quot;</span><span class="token punctuation">,</span>
      <span class="token property">&quot;name&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Launch Program&quot;</span><span class="token punctuation">,</span>
      <span class="token property">&quot;skipFiles&quot;</span><span class="token operator">:</span> <span class="token punctuation">[</span>
        <span class="token string">&quot;&lt;node_internals&gt;/**&quot;</span>
      <span class="token punctuation">]</span><span class="token punctuation">,</span>
      <span class="token property">&quot;program&quot;</span><span class="token operator">:</span> <span class="token string">&quot;\${file}&quot;</span><span class="token punctuation">,</span>
      <span class="token property">&quot;preLaunchTask&quot;</span><span class="token operator">:</span> <span class="token string">&quot;tsc: 构建 - tsconfig.json&quot;</span><span class="token punctuation">,</span>
      <span class="token property">&quot;outFiles&quot;</span><span class="token operator">:</span> <span class="token punctuation">[</span>
        <span class="token string">&quot;\${workspaceFolder}/**/*.js&quot;</span>
      <span class="token punctuation">]</span>
    <span class="token punctuation">}</span>
  <span class="token punctuation">]</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>现在我们配置好了文件，打开<code>demo.ts</code>文件，写入下面的代码：</p><div class="language-typescript line-numbers-mode" data-ext="ts"><pre class="language-typescript"><code><span class="token keyword">let</span> age<span class="token operator">:</span> <span class="token builtin">number</span> <span class="token operator">=</span> <span class="token number">20</span><span class="token punctuation">;</span>
<span class="token keyword">if</span> <span class="token punctuation">(</span>age <span class="token operator">&lt;</span> <span class="token number">50</span><span class="token punctuation">)</span> age <span class="token operator">+=</span> <span class="token number">10</span><span class="token punctuation">;</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>我们将第一行加入断点，这时候debug（可以使用F5快捷键）将会从第一行进行</p><p>左侧有VARLABLES/变量</p><p>其中，我们可以看到当前的age为undefined，那是因为<code>let age = 20</code>实际上是两行代码：<code>let age; age = 20;</code></p><p><img src="data:image/png;base64," alt=""></p><p>我们可以在watch/监视中指定想要监视的变量<code>age</code></p><p>通过F10（第二个蓝色按钮）来<code>执行下一行</code></p><p><img src="data:image/png;base64," alt=""></p><p>现在我们进行到第二行，可以看到age的值变成了20</p><p>但我们想看到age变为30，不过由于程序结束了，我们无法在debug中得到age:30</p><p>我们可以新加一行代码，让debug拿到age变化的值后再结束程序</p><p><img src="data:image/png;base64," alt=""></p>`,56),g=[e];function t(P,u){return A(),i("div",null,g)}const v=E(R,[["render",t],["__file","一、为什么需要TS以及配置与debug.html.vue"]]);export{v as default};
